import React, {useState} from "react";

const FullRecord = (rec) => {
    return (
        <div style="border: 1px">
            Имя: {rec.full_name}, телефон: {rec.phone}, электронная почта: {rec.email}
            Город: {rec.city}, улица: {rec.street}, дом: {rec.house}, подъезд: {rec.entrance}, этаж: {rec.floor}, квартира: {rec.office}, домофонг: {rec.City} <br />
        </div>
    );
};

export default FullRecord;
